import { Component } from 'react';
import { NavLink, Switch, Route} from 'react-router-dom';
import NewUnit from './newunit.js';

class Units extends Component {
	render(){
		return(
			<main>
				<nav id="sub-nav">
					<NavLink className="sub-nav-link" to="/new">New Unit</NavLink>
					<NavLink className="sub-nav-link" to="/report">Unit Report</NavLink>
					<NavLink className="sub-nav-link" to="/edit">Edit Unit</NavLink>
				</nav>

				<Switch>
					<Route path="/units/new">
						<NewUnit type="new"/>
					</Route>
					<Route path="/units/edit">
						<NewUnit type="edit"/>
					</Route>
					<Route exact path="/standards">
						<h2>Unit List</h2>
						<ul>

						</ul>
					</Route>
				</Switch>
			</main>
		)
	}
}

export default Units;
